import React from 'react';

const GroupDetail = () => {
  return (
    <div>
      <h2>그룹 상세 정보</h2>
      <p>그룹의 상세 정보와 이미지, 공감하기 버튼 등이 여기에 표시됩니다.</p>
    </div>
  );
};

export default GroupDetail;
